        var html = jQuery('<div class="calc"></div>');

        jQuery.each(types, function (idx, name) {

            if (!args.fromName) {
                args.fromName = text.from;
            }

            if (!args.toName) {
                args.toName = text.to;
            }

            if (name == "other") {
                if (args[name]) {
                    var others = args[name].split(",");
                    args[name] = "";
                    jQuery.each(others, function (idx, name) {
                        _this.addSelect(args, name, html, "other");
                    });
                }
            } else {
                _this.addSelect(args, name, html);
            }
        });

        if (jQuery(args.toolID + " .calc").length == 0) {
            jQuery(args.toolID).html(html);
        }
